        assembly {
            x := "my String"
        }

        return x;
    }

    function myStringAsHex() public pure returns (bytes32) {
        bytes32 x;

        assembly {
            x := "my String"
        }

        return x;
    }

    function myStringAsHexInReadingForm() public pure returns (string memory) {
        bytes32 x;

        assembly {
            x := "my String"
        }

